import { Card} from "./ui/card";
import { Button } from "./ui/button";
export function AnalyticsTab() {
  const dataSet = [
    {
        id: '1', 

      station: "Outpatient Stations",
      substations: [
        "Testicular Lump",
        "Raised PSA",
        "Haematuria",
        "Renal mass",
        "OAB",
      ],
    },
    {
      station: "Emergency Station",
      substations: ["AUR", "Renal colic", "Haematuria"],
    },
  ];
  return (
    <div>
      <Card>
        <h1>Urology Interview</h1>

        {dataSet.map((data) => (
          <div>
            <h2>{data.station}</h2>
            {data.substations.map((substation) => (
              <Button variant="ghost">{substation}ttt</Button>
            ))}
          </div>
        ))}
      </Card>
    </div>
  );
}
